import React, { useState } from 'react';
import { createSale } from '../../services/api';
import { useHistory } from 'react-router-dom';

const SaleForm = () => {
    const [form, setForm] = useState({
        human_id: '',
        product_id: '',
        outlet_id: '',
        date: '',
        price: '',
        quantity: '',
        staff_id: '',
    });

    const history = useHistory();

    const handleChange = (e) => {
        setForm({ ...form, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        await createSale(form);
        history.push('/sales');
    };

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" name="human_id" value={form.human_id} onChange={handleChange} placeholder="Human ID" />
            <input type="text" name="product_id" value={form.product_id} onChange={handleChange} placeholder="Product ID" />
            <input type="text" name="outlet_id" value={form.outlet_id} onChange={handleChange} placeholder="Outlet ID" />
            <input type="date" name="date" value={form.date} onChange={handleChange} />
            <input type="number" name="price" value={form.price} onChange={handleChange} placeholder="Price" />
            <input type="number" name="quantity" value={form.quantity} onChange={handleChange} placeholder="Quantity" />
            <input type="text" name="staff_id" value={form.staff_id} onChange={handleChange} placeholder="Staff ID" />
            <button type="submit">Create Sale</button>
        </form>
    );
};

export default SaleForm;
